    [],nt"num_tags": 45,nt"name": "annual-narrative-long-island-national-wildlife-refuge-complex-fiscal-year-1975",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Long Island
    National Wildlife Refuge Complex outlines Refuge accomplishments during the 1975
    fiscal year. The report begins by summarizing the weather conditions, habitat conditions,
    and food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    fish, reptiles, and diseases- is also covered. The Refuge development and maintenance
    section discusses physical developments. The public relations section of the report
    describes recreational uses, Refuge visitors, violations, and safety. There is a
    photograph included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
